import React, { useState } from "react";


const Form = () => {

    const message = "";
    let inputValue;

    const update = (e) => {
        inputValue = e.target.value
    }

    const [currentMessage, setMessage] = useState(message);

    const submit = (e) => {
        e.preventDefault();
        setMessage(inputValue);
    }

    return (
        <>
            <div>
                <div id="container">
                    <form onSubmit= {submit}>
                        <h3> {currentMessage} </h3>
                        <input type="text" placeholder="Enter Your Name" onChange={update} />
                        <button id="demo" type= "submit"> Submit </button>
                    </form>
                </div>
            </div>
        </>
    );
}


export default Form;
